public void init()
{
    super();

    if (!element.args() || !element.args().caller() || !(element.args().caller() is CustCollectionsICollectionManagerWorkspace))
    {
        throw error("@AccountsReceivable:ErrorExpectedCallerArgs");
    }

    listPageHelper = CustCollectionsCrossCompanyListPageHelper::construct(poolFilter);
}

    /// <summary>
    /// Updates the pool filter based on the selected company and then defaults the values
    /// </summary>
    public void updateCurrentPoolFilters()
    {
		listPageHelper.updateCompany(element.parmCompany());
        listPageHelper.loadPools();

        poolFilter.text(listPageHelper.getCurrentAgent().DefaultCustomerPool);

        poolFilter.enabled(listPageHelper.getCurrentAgent().RecId != 0);
    }

/// <summary>
///
/// </summary>
public void executeQuery()
{
    if (CustCollectionsWorkspaceHelper::updateFormPartFiltersFromCallerWorkspace(element.args().caller() as CustCollectionsICollectionManagerWorkspace, element as CustCollectionsIWorkspaceFormPart))
    {
        element.updateCurrentPoolFilters();
    }

    CustCollectionsPool		custCollectionsPool;
    QueryBuildDataSource	qbd;

    HMClaimTable_1_ds.query().dataSourceName("HMClaimTable_1").clearRanges();

    qbd = HMClaimTable_1_ds.query().dataSourceTable(tableNum(HMClaimTable));

    if(poolFilter.text() != "")
    {
        select RecId from custCollectionsPool
            where custCollectionsPool.Name == poolFilter.text();
        qbd.addRange(fieldNum(HMClaimTable,ClaimPool)).value(SysQuery::value(custCollectionsPool.RecId));
    }

    qbd.addRange(fieldNum(HMClaimTable,DataAreaId)).value(element.parmCompany());

    this.queryBuildDataSource().addRange(fieldNum(HMClaimTable, MzkClaimAgingDays)).value("> 30"); 

    super();
}

public boolean modified()
{
    boolean ret = super();

    if (ret && strLen(this.text()) && !listPageHelper.checkPoolExists(this.text()))
    {
        ret = checkFailed("@AccountsReceivable:CustCollectionsPoolDoesNotExistsError");
    }

    if (ret)
    {
        HMClaimTable_1_ds.executeQuery();
        contentGrid.setFocus();
    }

    return ret;
}

/// <summary>
///
/// </summary>
public void jumpRef()
{
    super();

    Args			args = new Args();
    HMClaimTable	hmClaimTable;

    select firstonly1 * from hmClaimTable
        where hmClaimTable.ClaimID == this.text();

    MenuFunction menuFunction = new MenuFunction(MenuItemDisplayStr(mzkCustCollectionsForMyActiveClaims), MenuItemType::Display);

    args.record(hmClaimTable);
    args.caller(element);

    menuFunction.run(args);
}
